emmas unsure and unprepared to be a parent. Under intense pressure at work, Gemma decides to pair her M3GAN prototype with Cady in an attempt to resolve both problemsa decision that will have unimaginable consequences. \n\nProduced by Jason Blum and James Wan, M3GAN is directed by award-winning filmmaker Gerard Johnstone (Housebound), from a screenplay by Akela Cooper (Malignant, The Nun 2) based on a story by Akela Cooper and James Wan. \n\nThe film also stars Ronny Chieng (Shang-Chi and the Legend of the Ten Rings), Brian Jordan Alvarez (Will \u0026 Grace), Jen Van Epps (Cowboy Bebop), Lori Dungey (The Lord of the Rings: The Fellowship of the Ring, extended edition) and Stephane Garneau-Monten (Straight Forward).\n\nUniversal Pictures and Blumhouse present an Atomic Monster production in association with Divide/Conquer. The films executive producers are Allison Williams, Mark Katchur, Ryan Turek, Michael Clear, Judson Scott, Adam Hendricks and Greg Gilreath.\n\nWebsite: https://www.m3ganmovie.com/\nInstagram: https://www.instagram.com/meetm3gan/\nTwitter: https://twitter.com/meetM3GAN\nFacebook: https://www.facebook.com/meetM3GAN\nTikTok: https://www.tiktok.com/@meetm3gan?lang=en\n#M3GAN","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/BRb4U99OU80/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCgdXLLb2wnKAWA6d6cPeMvL0rYCQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/BRb4U99OU80/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLD2ejGGmZT4z96j6pU8GnpyhIuwFA","width":196,"height":110},{"url":"https://i.ytimg.com/vi/BRb4U99OU80/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLBIfVQC8e28YkJ8QNVLwO1j5nADmA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/BRb4U99OU80/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLAHue-NxWZjawk53mb7jjMziaYzqA","width":336,"height":188},{"url":"https://i.ytimg.com/vi_we lity":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"meet M3GAN. your new best friend.\n\nM3GAN - official trailer\nonly in theaters january 6\n\nFrom the most prolific minds in horrorJames Wan, the filmmaker behind the Saw, Insidious and The Conjuring franchises, and Blumhouse, the producer of the Halloween films, The Black Phone and The Invisible Mancomes a fresh new face in terror. \n\nM3GAN is a marvel of artificial intelligence, a life-like doll programmed to be a childs greatest companion and a parents greatest ally. Designed by brilliant toy-company roboticist Gemma (Get Outs Allison Williams), M3GAN can listen and watch and learn as she becomes friend and teacher, playmate and protector, for the child she is bonded to. \n\nWhen Gemma suddenly becomes the caretaker of her orphaned 8-year-old niece, Cady (Violet McGraw, The Haunting of Hill House), Gemmas unsure and unprepared to be a parent. Under intense pressure at work, Gemma decides to pair her M3GAN prototype with Cady in an attempt to resolve both problemsa decision that will have unimaginable consequences. \n\nProduced by Jason Blum and James Wan, M3GAN is directed by award-winning filmmaker Gerard Johnstone (Housebound), from a screenplay by Akela Cooper (Malignant, The Nun 2) based on a story by Akela Cooper and James Wan. \n\nThe film also stars Ronny Chieng (Shang-Chi and the Legend of the Ten Rings), Brian Jordan Alvarez (Will \u0026 Grace), Jen Van Epps (Cowboy Bebop), Lori Dungey (The Lord of the Rings: The Fellowship of the Ring, extended edition) and Stephane Garneau-Monten (Straight Forward).\n\nUniversal Pictures and Blumhouse present an Atomic Monster production in association with Divide/Conquer. The films executive producers are Allison Williams, Mark Katchur, Ryan Turek, Michael Clear, Judson Scott, Adam Hendricks and Greg Gilreath.\n\nWebsite: https://www.m3ganmovie.com/\nInstagram: https://www.instagram.com/meetm3gan/\nTwitter: https://twitter.com/meetM3GAN\ her M3GAN prototype with Cady in an attempt to resolve both problemsa decision that will have unimaginable consequences. \n\nProduced by Jason Blum and James Wan, M3GAN is directed by award-winning filmmaker Gerard Johnstone (Housebound), from a screenplay by Akela Cooper (Malignant, The Nun 2) based on a story by Akela Cooper and James Wan. \n\nThe film also stars Ronny Chieng (Shang-Chi and the Legend of the Ten Rings), Brian Jordan Alvarez (Will \u0026 Grace), Jen Van Epps (Cowboy Bebop), Lori Dungey (The Lord of the Rings: The Fellowship of the Ring, extended edition) and Stephane Garneau-Monten (Straight Forward).\n\nUniversal Pictures and Blumhouse present an Atomic Monster production in association with Divide/Conquer. The films executive producers are Allison Williams, Mark Katchur, Ryan Turek, Michael Clear, Judson Scott, Adam Hendricks and Greg Gilreath.\n\nWebsite: https://www.m3ganmovie.com/\nInstagram: https://www.instagram.com/meetm3gan/\nTwitter: https://twitter.com/meetM3GAN\nFacebook: https://www.facebook.com/meetM3GAN\nTikTok: https://www.tiktok.com/@meetm3gan?lan...\n#M3GAN","commandRuns":[{"startIndex":1788,"length":27,"onTap":{"innertubeCommand":{"clickTrackingParams":"CB8Q040EGAIiEwi_t5ay-p7-AhWHYxYKHYDXAVRIzae5-r2KvosF","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnZ1NGVUM1dzcFQxT2lxMmZ1NDFTd1V6OTdMd3xBQ3Jtc0tsejBqSXBKQU8zb2d0Z1ZSbExVZVlJTkM2RHZhdTlfR0dGOHNMQ3RobE05TEVVUm9MM28xRG5BZDBPV1hlS09ZZmVrZmI3RkNtSlBTQVFEalBXenFqZFhqT0tCX3cxVWViQ0lZcmFVUWlCRkdYdjNRRQ\u0026q=https%3A%2F%2Fwww.m3ganmovie.com%2F\u0026v=BRb4U99OU80","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbnZ1NGVUM1dzcFQxT2lxMmZ1NDFTd1V6OTdMd3xBQ3Jtc0tsejBqSXBKQU8zb2d0Z1ZSbExVZVlJTkM2RHZhdTlfR0dGOHNMQ3RobE05TEVVUm9MM28xRG5BZDBPV1hlS09ZZmVrZmI3RkNtSlBTQVFEalBXenFqZFhqT0tCX3cxVWViQ0lZcmFVUW
